      | 355740 -> { ItemTypeData.id= 355740; name= "Wiyrkomi Breach Forge Gun"; published= false; description= "Adapted from Deep Core Mining Inc.'s proprietary technology, the DCMA S-1 subverts conventional expectations of what a man-portable anti-material weapons platform is capable of. Despite its excessive weight and extended recharge time, the “Forge Gun” as it has become known, is regarded as the most devastating infantry weapon on the battlefield, and an invaluable tool for those capable of wielding it.  Powered by a Gemini microcapacitor, the forge gun utilizes a stored electric charge to fire kinetic slugs at speeds in excess of 7,000 m/s, enough to penetrate even augmented armor systems. During the pre-fire charge, the forward armature locks into position, stabilizing the magnetic field and helping to shield the user from backscatter and the excessive heat produced.  Power generation remains the single largest drawback of the current design, the onboard capacitor requiring a significant amount of time to reach full power after each discharge. "; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
