      | 369417 -> { ItemTypeData.id= 369417; name= "Standard Logistics C-I"; published= false; description= "The Logistics dropsuit is outfitted with the latest in integrated diagnostic technology, most of which revolves around maintaining the condition and efficiency of squad mates and their equipment. As such, a soldier equipped with this class of dropsuit becomes a force multiplier, greatly improving the overall effectiveness of the unit.    Offering only the ruthless, bare-minimum functionality needed to ensure operator survivability, this is a triage suit unfettered by conventional rationale. Like most Caldari designs, utility is paramount and so all integrated tech is optimized for secondary support; resupplying and repairing units from distance, only engaging the enemy when absolutely necessary.    When deployed, a soldier equipped with a Logistics suit fills a vital tactical role in small unit operations and full-scale warfare, providing both, medical and mechanical support."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
