      | 45534 -> { ItemTypeData.id= 45534; name= "Monitor"; published= true; description= "The Monitor was initially developed by the CONCORD Directive Intelligence Agency as an observation ship that could survive extremely hostile areas of space for observation and data collection missions against pirate, capsuleer, and emergent threats. To serve in this role the Monitor was developed with defensive technology inspired by the venerable  Polaris  line of frigates. After initial field testing demonstrated the incredible durability of this new vessel, CONCORD Aerospace realized that a civilian version would potentially prove valuable to capsuleer fleet commanders and the Inner Circle approved the distribution of blueprint copies directly to worthy capsuleers through the  loyalty point  program.    Flag Cruisers like the Monitor are specialized in survivability and observation at the expense of virtually all other functions. Powerful shield generators and thick armor plating combine with the smallest signature radius of any cruiser to create one of the most durable ships ever seen in New Eden. The Monitor also enjoys impressive sensor capabilities and digital systems hardened against hostile electronic warfare. In exchange for these benefits the Monitor gives up virtually all offensive capabilities and utility. The Monitor is only able to use propulsion modules, low-power target painters, and probe launchers. This ship is the ultimate specialist, useful for fleet commanders who serve as a stable presence on a chaotic battlefield."; marketGroupId= Some(2417); groupId= 1972; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 3; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 16000000.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 2000.000000 }; { DogmaAttributeValueData.attributeId = 1547; value= 2.000000 }; { DogmaAttributeValueData.attributeId = 12; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 13; value= 3.000000